VALUES ('7617027955430', 'Sushi salmon roll mix', 'Ingrédiene: riz cuit 45 % [riz, eau, vinaigre de riz, sucre, sel de cuisine, tréhalose (source de glucose), huile de tournesol), saumon Atlantique (Salmo salar): fumé 12 0%, cru 11 0%, cuit 9 0%, gingembre mariné 4 % [gingembre eau, sel de cuisine, acidifiants: acide acétique et acide citrique, exhausteur de goût: glutamate monosodique, conservateur: E 202, &julcorants: E 955, aspartame (contient une source de phénylalanine) et saccharines], sauce de soja (contient blé), radis blancs marinés [radis blancs sucre, curcuma, sel de cuisine, vinaigre de riz], concombres, mayonnaise (avec jaune d\'oeuf [d\'oeufs d\'élevage au sol], soja. acidifiant; acide citrique), sauce &quot;Teriyaki&quot; [sauce de soja (contient blé) sucrq miel. vin de riz &quot;Mirin&quot; (avec acidifiants: acide citrique et E 338), amidon de maïs], préparation de raifort avec 5 % wasabi (avec stabilisant: sorbitol, l&tose, soja, épaississant: E 415, colorant: E 133), oeufs de poisson volant (Cheilopogon Atrisignis et Hirundichthys Speculiger) 1 % (avec sel de cuisine, sucre, fructose, colorants: E 129, E 110), graines de sésame, algues (Nori), préparation de raifort (avec jaune d\'oeuf [dloeufs d\'élevage au solli épaississants: E 415 et gomme guar, conservateur. disulfite de sodium, acidifiant: acide citrique), aneth mélange de condiments &quot;Dashi no moto&quot; (avec exhausteurs de goût: glutamate monosodique et E 631, poisson en poudre, acidifiant: E 363). | Les colorants E 110 et E 129 peuvent avoir des effets indésirables sur l\'activité et l\'attention chez les enfants', 'https://static.openfoodfacts.org/images/products/761/702/795/5430/front_fr.4.400.jpg', '8', '1', '16', '4.5', '0.5', '9', '1.6', '0.62992125984252', '', '0');

